tables.table_schema:
CREATE TABLE voice_interaction_data (
    id INT PRIMARY KEY,
    user_id INT,
    voice_text TEXT,
    interaction_date TIMESTAMP
);

CREATE TABLE voice_assistant_accuracy (
    id INT PRIMARY KEY,
    interaction_id INT,
    accuracy_score FLOAT,
    feedback TEXT
);

CREATE TABLE VoiceInteractions (
    interaction_id INT PRIMARY KEY,
    user_id INT,
    timestamp TIMESTAMP,
    voice_input TEXT
);

CREATE TABLE Users (
    user_id INT PRIMARY KEY,
    name TEXT,
    email TEXT UNIQUE,
    age INT
);

CREATE TABLE users (
    user_id UUID PRIMARY KEY,
    username TEXT,
    email TEXT,
    registration_date DATE
);

CREATE TABLE voice_models (
    model_id UUID PRIMARY KEY,
    model_name TEXT,
    model_version TEXT,
    trained_date DATE
);

CREATE TABLE voice_interactions (
    interaction_id INT PRIMARY KEY,
    user_id INT,
    timestamp TIMESTAMP,
    transcript TEXT
);

CREATE TABLE users (
    user_id INT PRIMARY KEY,
    username VARCHAR(50),
    email VARCHAR(100)
);

CREATE TABLE audio_files (
    file_id INT PRIMARY KEY,
    interaction_id INT,
    audio_data BYTEA
);

CREATE TABLE transcripts (
    transcript_id INT PRIMARY KEY,
    interaction_id INT,
    transcript TEXT
);

CREATE TABLE analysis_results (
    result_id INT PRIMARY KEY,
    interaction_id INT,
    analysis_data JSONB
);
